import React from 'react';
import './content_signup.css';
import RegDetails from './RegDetails';
import BusDetails from './BusDetails';



class ContentSignUp extends React.Component{
  render(){
    return(
      <div className="text-center" id="SignupContent">
         <button className="btn mt-5" type="button" data-toggle="collapse" data-target=".multi-collapse" aria-expanded="false" aria-controls="multiCollapse1 multiCollapse2">Regular Customer</button>

          {RegDetails.map((item)=>{
            return(
              <div class="collapse show multi-collapse" id={item.id}>
                  <div className={item.classN}>
                    <label for={item.for} class={item.labelC}>{item.name}</label>
                    <input class={item.inputC} type={item.type}/>
                  </div>
                </div>

            )})}
            {SignUpDetails.map((item)=>{
              return(
                ((item.id in item)==0)?
                <div class="collapse multi-collapse" id="multiCollapse2">
                  <div className={item.classN}>
                    <label for={item.for} class={item.labelC}>{item.name}</label>
                    <input class={item.inputC} type={item.type}/>
                  </div>
                </div>:
                null
                )})}
          </div>
      )
  }
}
export default ContentSignUp
